import React from 'react';

const addShip = () => {
    const navigateShips = () => {
        window.history.go('/ships')
    };
    return (
        <div className="add-ship-container">
            <button id="ship-button" onClick={navigateShips}>Add Ship</button>
        </div>
    )
};

export default addShip;
